import React from 'react';

const date = new Date()

const Header = () => {
  return (
    <div>
      <div className="footer">
        <p>Copyright {date.getFullYear()} Home360 | Terms of Service</p>
      </div>
      <style>{`
        .footer {
          background: green;
          height: 60px;
          width: 100%;
        }
      `}</style>
    </div>
  )
}

export default Header;
